function NavLink(props) {
  return (
    <nav>
      <ul>
        {props.links.map((link, index) => (
          <li key={index}>
            <a href={link.url}>{link.text}</a>
          </li>
        ))}
      </ul>
    </nav>
  );
}
export default NavLink;
